-- Task 3: Part A - Create the trigger function
CREATE OR REPLACE FUNCTION check_set_parts_consistency()
RETURNS TRIGGER AS $$
DECLARE
  relevant_set_num TEXT;
  actual_parts INTEGER;
  stored_num_parts INTEGER;
BEGIN
  -- Determine which set_num to check based on the table that fired the trigger
  IF TG_TABLE_NAME = 'lego_sets' OR TG_TABLE_NAME = 'lego_inventories' THEN
    relevant_set_num := NEW.set_num;
  ELSIF TG_TABLE_NAME = 'lego_inventory_parts' THEN
    -- For lego_inventory_parts, we need to find the set_num via the inventory
    SELECT set_num INTO relevant_set_num
    FROM public.lego_inventories
    WHERE id = NEW.inventory_id;
  END IF;

  -- If we couldn't find a set_num, skip the check
  IF relevant_set_num IS NULL THEN
    RETURN NEW;
  END IF;

  -- Calculate the actual part count for this set
  SELECT COALESCE(SUM(lip.quantity), 0)
  INTO actual_parts
  FROM public.lego_inventories i
  INNER JOIN (
    SELECT set_num, MAX(version) as max_version
    FROM public.lego_inventories
    WHERE set_num = relevant_set_num
    GROUP BY set_num
  ) latest ON i.set_num = latest.set_num AND i.version = latest.max_version
  LEFT JOIN public.lego_inventory_parts lip
    ON lip.inventory_id = i.id AND lip.is_spare = false;

  -- Get the stored num_parts from lego_sets
  SELECT num_parts INTO stored_num_parts
  FROM public.lego_sets
  WHERE set_num = relevant_set_num;

  -- Raise an exception if there's a mismatch
  IF actual_parts != stored_num_parts THEN
    RAISE EXCEPTION 'Inconsistent part count for set %: expected %, but calculated %', 
      relevant_set_num, stored_num_parts, actual_parts;
  END IF;

  -- Return NEW if the check passes
  RETURN NEW;
END;
$$ LANGUAGE plpgsql
"}
